import Header from "../../components/Header/Header";
import Footer from "../../components/Footer/Footer";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.esm.js";
import "https://unpkg.com/ionicons@7.1.0/dist/ionicons/ionicons.js";
import "./Authorisation.css"
import axios from "axios";
import React, {Fragment, useState} from "react";
import {Link} from "react-router-dom";
import {ERROR_ROUTE, HOME_ROUTE, SIGNIN_ROUTE, VERIFICATION_ROUTE} from "../../utils/consts";

function getRand(min, max) {
    return Math.floor(Math.random() * (max - min)) + min
}
export const code = getRand(111111, 999999)
const LogIn = () => {

    const history = useHistory

    const [Mail, setMail] = useState('');
    const [Firstname, setFirstname] = useState('');
    const [Lastname, setLastname] = useState('');
    const [Password1, setPassword1] = useState('');
    const [Password2, setPassword2] = useState('');

    const sendData = () => {
        localStorage.setItem("Mail", Mail);
        localStorage.setItem("Firstname", Firstname);
        localStorage.setItem("Lastname", Lastname);
        localStorage.setItem("Password1", Password1);
        localStorage.setItem("Password2", Password2);
    }





    const sendCode = (e) => {
        e.preventDefault()
        axios.post(
            "http://localhost:8080/send",
            {
                "recipient": {
                    Mail,
                },
                "code": code
            }
        ).then(res => {
            if (res) {
                sendData()
            }
        }).catch(() => {
            alert("Некорректная почта!")
            redirect(HOME_ROUTE)
        })
    }

    return (
        <div>
            <Header />
            <div style={{
                width: "100%",
                height: "946px",
                display: "flex",
                alignItems: "center",
                justifyContent: "center"
            }}>
                <Fragment>
                    <div>
                        <div className="wrapper1">
                            <Link to="/">
                                <div className='icon-close'>
                                    <ion-icon name="close" />
                                </div>
                            </Link>
                            <div className="form-box">
                                <h2>Зарегистрироваться</h2>
                                {/*<form>*/}

                                <div className="input-box">
                                        <span className={'icon'}>
                                            <ion-icon name={"mail"}></ion-icon>
                                        </span>
                                    <input type="text" onChange={(e) => {
                                        setMail(e.target.value)
                                    }}/>
                                    <label>{"Mail"}</label>
                                </div>

                                <div className="input-box">
                                        <span className={'icon'}>
                                            <ion-icon name={"person"}></ion-icon>
                                        </span>
                                    <input type="text" onChange={(e) => {
                                        setFirstname(e.target.value)
                                    }}/>
                                    <label>{"Firstname"}</label>
                                </div>

                                <div className="input-box">
                                        <span className={'icon'}>
                                            <ion-icon name={"person"}></ion-icon>
                                        </span>
                                    <input type="text" onChange={(e) => {
                                        setLastname(e.target.value)
                                    }}/>
                                    <label>{"Lastname"}</label>
                                </div>

                                <div className="input-box">
                                        <span className={'icon'}>
                                            <ion-icon name="lock-closed"></ion-icon>
                                        </span>
                                    <input type="text" onChange={(e) => {
                                        setPassword1(e.target.value)
                                    }}/>
                                    <label>{"Password1"}</label>
                                </div>

                                <div className="input-box">
                                        <span className={'icon'}>
                                            <ion-icon name="lock-closed"></ion-icon>
                                        </span>
                                    <input type="text" onChange={(e) => {
                                        setPassword2(e.target.value)
                                    }}/>
                                    <label>{"Password2"}</label>
                                </div>

                                <div className="text-center">
                                    <Link to={SIGNIN_ROUTE}>
                                        Войти
                                        {/*{code}*/}
                                    </Link>
                                    <Link to={VERIFICATION_ROUTE}>
                                        <button type="submit" className="btn" onClick={(e)=>{
                                            sendCode(e)
                                        }}>
                                            Зарегистрироваться
                                        </button>
                                    </Link>
                                </div>

                                {/*</form>*/}
                            </div>
                        </div>
                    </div>
                </Fragment>
            </div>
            <Footer />
        </div>
    );
};
export default LogIn
